  if (item instanceof com.cloudbees.hudson.plugins.folder.Folder || item instanceof org.jenkinsci.plugins.workflow.job.WorkflowJob){
    println(item.name + " can't include, skipping")
  }else{
  notification = item.getPublishersList()
