332029395 This could probably be cleaned up but the following patch is working for me with Sonar 5.6 now. Instead of 498 projects, I receive around 9531 projects.
```
$ diff -u DefaultSonarClient.java.orig DefaultSonarClient.java
--- DefaultSonarClient.java.orig        2017-09-25 20:32:15.501017680 +0100
+++ DefaultSonarClient.java     2017-09-25 22:21:11.128801784 +0100
@@ -34,11 +34,13 @@
 public class DefaultSonarClient implements SonarClient {
     private static final Log LOG = LogFactory.getLog(DefaultSonarClient.class);

-    private static final String URL_RESOURCES = "/api/resources?format=json";
+    private static final String URL_PROJECTS = "/api/projects/index?format=json";
+    //private static final String URL_RESOURCES = "/api/resources?format=json";
     private static final String URL_RESOURCE_DETAILS = "/api/resources?format=json&resource=%s&metrics=%s&includealerts=true";

     private static final String DATE_FORMAT = "yyyy-MM-dd'T'HH:mm:ssZ";
     private static final String ID = "id";
+    private static final String FIVESIX_NAME = "nm";
     private static final String NAME = "name";
     private static final String KEY = "key";
     private static final String VERSION = "version";
@@ -65,7 +67,7 @@
     @Override
     public List<SonarProject> getProjects(String instanceUrl) {
         List<SonarProject> projects = new ArrayList<>();
-        String url = instanceUrl + URL_RESOURCES;
+        String url = instanceUrl + URL_PROJECTS;

         try {

@@ -75,7 +77,9 @@
                 SonarProject project = new SonarProject();
                 project.setInstanceUrl(instanceUrl);
                 project.setProjectId(str(prjData, ID));
-                project.setProjectName(str(prjData, NAME));
+                project.setProjectName(str(prjData, FIVESIX_NAME));
                 projects.add(project);
             }
``` equick
